import axios from "axios";
import { useState, useEffect } from "react";

const [data, setData] = useState();
export default function Search(keyword) {   
    useEffect(() => {
        axios
            .post('http://localhost:3001/search', {
                keyword,
            })
            .then(res => {
                setData(res.data.item);
            })
            .catch(err => {
                console.err(err);
            })  
    },);
    return data;    
    
}
